import React from 'react';
import coffeecup from '../../vector.png'
// import { Link } from 'react-router-dom'

class NuffCoffeeCup extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      coffeecount: 0
    };
  }
  coffeeCounter = () => {
    this.setState ({
      coffeecount: this.state.coffeecount+1
    }) 
  }

  render() {
    return(
            <div class="coffeecupcontainer">
                <img class="coffeecup" src={coffeecup} alt="nuffcoffeecup"/>
            </div>)
  }
}
export default NuffCoffeeCup;
